import React from 'react';

function StatusBar(status) {
  const colorStatus = () => {
    switch (status) {
      case 'Alive':
        return 'green';
      case 'Dead':
        return 'red';
      case 'unknown':
        return 'purple';
    }
  };
  return <div style={{ backgroundColor: { colorStatus } }}></div>;
}

export default StatusBar;
